INSERT INTO "public"."events" VALUES (0.18077326714880315, 'Балет С.Прокофьев "Золушка"', '/img/zolushka.jpg', 16, 'Театр оперы и балета', 'theatre', 'Золушка — балет в трёх актах Сергея Прокофьева. Либретто Николая Волкова по сюжету одноимённой сказки Шарля Перро. Переложение для фортепиано в 2 руки сделал Л. Т. Атовмян. 26 июня 1946 года за этот балет композитор был награждён Сталинской премией.');
INSERT INTO "public"."events" VALUES (0.07764903398705947, 'Концерт симфонической музыки', '/img/orchestr.png', 22, 'Театр оперы и балета', 'concert', 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolorem repellat nisi deserunt accusantium fugiat quam, voluptate quae repellendus hic dolor placeat dolorum. Quod non maiores earum quia deserunt distinctio eveniet.Obcaecati neque id praesentium et dolores, iure dicta reprehenderit laborum possimus unde at deserunt voluptatibus atque error quisquam hic, repellat commodi excepturi culpa soluta distinctio, voluptas aliquid! Distinctio, inventore tempore.');
INSERT INTO "public"."events" VALUES (0.7142711297056972, 'Solo - мелодия души', '/img/solo.jpg', 55, 'Театр оперы и балета', 'concert', 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolorem repellat nisi deserunt accusantium fugiat quam, voluptate quae repellendus hic dolor placeat dolorum. Quod non maiores earum quia deserunt distinctio eveniet.Obcaecati neque id praesentium et dolores, iure dicta reprehenderit laborum possimus unde at deserunt voluptatibus atque error quisquam hic, repellat commodi excepturi culpa soluta distinctio, voluptas aliquid! Distinctio, inventore tempore.');
INSERT INTO "public"."events" VALUES (0.039814822538933425, 'Аватар', '/img/avatar.jpg', 35, 'Кинотеатр "Премьер зал"', 'movie', 'После принятия образа аватара солдат Джейк Салли становится предводителем народа на`ви и берет на себя миссию по защите новых друзей от корыстных бизнесменов с Земли. Теперь ему есть за кого бороться — с Джейком его прекрасная возлюбленная Нейтири. Когда на Пандору возвращаются до зубов вооруженные земляне, Джейк готов дать им отпор.');
INSERT INTO "public"."events" VALUES (0.4099256225854093, 'Кот в сапогах: Последнее желание', '/img/poos.png', 35, 'Кинотеатр "Кохи Навруз"', 'movie', 'Кот в сапогах потратил восемь из девяти отпущенных ему жизней и теперь отправляется в новое приключение, чтобы отыскать мифическое Последнее желание и восстановить свои жизни.');
INSERT INTO "public"."events" VALUES (0.2172673520525894, 'Вавилон', '/img/babylon.jpg', 35, 'Кинотеатр "Кохи Навруз"', 'movie', 'Голливуд, конец 1920-х. Звезды немого кино пытаются найти место в новом мире, где набирают популярность звуковые фильмы. Успешная карьера старых кумиров неумолимо близится к закату.');
INSERT INTO "public"."events" VALUES (0.22194766576933023, 'Операция "Фортуна": Искусство побеждать', '/img/fortune.jpg', 35, 'Кинотеатр "Премьер зал"', 'movie', 'Элитный разведчик Орсон Форчун получил новое задание: остановить продажу и распространение смертельного оружия. Но в одиночку ему эту миссию не потянуть. Он вынужден объединиться с лучшими оперативниками мира, а также известным киноактером, который предоставит лихой группе убедительное прикрытие. На кону судьба человечества, но на этот раз супершпионам придется играть по правилам Голливуда.');
INSERT INTO "public"."events" VALUES (0.007527530586934894, 'Мой ужасный сосед', '/img/neighbor.jpeg', 35, 'Кинотеатр "Премьер зал"', 'movie', 'Когда весёлая молодая семья переезжает в соседний дом, Отто встречает пару в своей манере, но вскоре неожиданная дружба с сообразительной и глубоко беременной Марисоль перевернёт его мир с ног на голову.');
INSERT INTO "public"."events" VALUES (0.9653370757772044, 'Чебурашка', '/img/cheburashka.jpg', 35, 'Кинотеатр "Кохи Навруз"', 'movie', 'Что, если Чебурашка на самом деле существует? Что, если он — не плюшевая игрушка, а вполне себе настоящий мохнатый зверек, который живет в апельсиновой роще в далёкой стране..');
INSERT INTO "public"."events" VALUES (0.9896104677400595, 'Билет в национальный музей', '/img/museum-ticket.jpg', 6, 'Национальный музей', 'museum', 'Национальный музей Таджикистана расположен в столице Таджикистана Душанбе. До 2011 года носил имя знаменитого персидского художника-миниатюриста Камольиддина Бихзода, работавшего при дворах Хусейна Байкара и Исмаила I. В марте 2013 года с переездом в новое здание носит название — Национальный музей Таджикистана.
//     12 августа 1934 года вышло совместное постановление ЦИК и СНК СССР об образовании музеев в Таджикистане. Народный комиссариат Таджикистана издал указ об образовании музея имени К. Бехзада в городе Душанбе. В 1959 году музей преобразован в республиканский объединённый музей историко-краеведческих и изобразительных искусств. 27 ноября 1999 года по Постановлению Правительства Республики Таджикистан музей имени К. Бехзада получил национальный статус.');

